import Loader from "react-loader-spinner";
import "react-loader-spinner/dist/loader/css/react-spinner-loader.css";
const CLoader = () => {
  //other logic
  const parentOverlay = {
      position: "fixed",
      top: 0,
      left: 0,
      background: "#666 !important",
      opacity: 0.8,
      zIndex: 998,
      height: '100%',
      width: '100%',
    };
  return (
    <div className="parentOverlay" width="100%">
      <div className="overlay-box">
        <Loader
          type="ThreeDots"
          color="#00BFFF"
          height={100}
          width={100}
        />
      </div>
    </div>
  );
}

export default CLoader
